<!DOCTYPE html>
<html lang="en">

<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Zoom Workshop 帳號在線時間分析</title>
    <style>
        /* 全局樣式 */
        body {
            font-family: Arial, sans-serif;
            margin: 20px;
            line-height: 1.6;
            color: #333;
            background-color: #f4f7f9;
        }

        h1 {
            color: #2c3e50;
            text-align: center;
            margin-bottom: 10px;
        }

        h3 {
            color: #34495e;
        }

        ul {
            list-style-type: none;
            padding: 0;
        }

        li {
            margin: 5px 0;
        }

        .no-copy {
            user-select: none;
            -webkit-user-select: none;
            -moz-user-select: none;
            -ms-user-select: none;
            -o-user-select: none;
        }

        /* 文本區域 */
        textarea {
            padding: 10px;
            font-size: 14px;
            border: 1px solid #ccc;
            border-radius: 5px;
            width: 48%;
            height: 150px;
            resize: none;
            box-shadow: 0 2px 5px rgba(0, 0, 0, 0.1);
        }

        #container {
            display: flex;
            justify-content: space-between;
            margin-bottom: 20px;
        }

        /* 按鈕樣式 */
        button {
            padding: 10px 20px;
            font-size: 16px;
            cursor: pointer;
            background: linear-gradient(45deg, #42a5f5, #007bff);
            color: white;
            border: none;
            border-radius: 5px;
            box-shadow: 0 2px 5px rgba(0, 0, 0, 0.2);
        }

        button:hover {
            background: linear-gradient(45deg, #007bff, #42a5f5);
        }

        .copy-btn {
            margin-top: 10px;
            font-size: 12px;
            padding: 5px 10px;
        }

        /* 結果區域樣式 */
        #result {
            margin-top: 20px;
        }

        /* 全寬區塊 */
        .full-width {
            width: 100%;
            background-color: #e3f2fd;
            padding: 15px;
            margin-bottom: 20px;
            border-radius: 8px;
            box-shadow: 0 3px 8px rgba(0, 0, 0, 0.1);
        }

        /* 父容器：每行兩個區塊 */
        .row {
            display: flex;
            justify-content: space-between;
            gap: 20px;
            margin-bottom: 20px;
        }

        /* 每個區塊樣式 */
        .half-width {
            width: calc(50% - 10px);
            /* 保留間距 */
            padding: 15px;
            border-radius: 8px;
            box-shadow: 0 3px 8px rgba(0, 0, 0, 0.1);
        }

        /* 每個區塊不同顏色 */
        #consolidatedSection {
            background-color: #ffecb3;
            /* 淡黃色 */
        }

        #under15Section {
            background-color: #fbe9e7;
            /* 淡橙色 */
        }

        #uniqueSection {
            background-color: #f1f8e9;
            /* 淡綠色 */
        }

        #duplicateSection {
            background-color: #ffe0b2;
            /* 淡杏色 */
        }

        /* 響應式支持 */
        @media (max-width: 768px) {
            .row {
                flex-direction: column;
            }

            .half-width {
                width: 100%;
            }
        }

        /* 頁腳樣式 */
        footer {
            margin-top: 30px;
            font-size: 14px;
            text-align: center;
            color: #666;
        }

        footer a {
            color: #007bff;
            text-decoration: none;
        }

        footer a:hover {
            text-decoration: underline;
        }
    </style>
</head>
